    public static String toWord(String encodedText) throws UnsupportedEncodingException {
        final Base64.Decoder decoder = Base64.getDecoder();
        String s1 = new String(decoder.decode(encodedText), "UTF-8");
        String s2 = new String(decoder.decode(s1), "UTF-8");
        String s3 = new String(decoder.decode(s2), "utf-8");
        return s3;
    }

    //base64字符串转化成图片
    //        String imgStr = "data:image/jpeg;base64,";
    //        toImg(imgStr);
    public static File toImg(String fileBase64String) {
        fileBase64String = fileBase64String.replace("data:image/jpeg;base64,", "");
        BufferedOutputStream bos = null;
        FileOutputStream fos = null;
        File file = null;
        try {
            BASE64Decoder decoder = new BASE64Decoder();
            byte[] bfile = decoder.decodeBuffer(fileBase64String);
            file = new File("C:\\Users\\hj\\Desktop\\test.jpg");
            fos = new FileOutputStream(file);
            bos = new BufferedOutputStream(fos);
            bos.write(bfile);
            return file;
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        } finally {
            if (bos != null) {
                try {
                    bos.close();
                } catch (IOException e1) {
                    e1.printStackTrace();
                }
            }
            if (fos != null) {
                try {
                    fos.close();
                } catch (IOException e1) {
                    e1.printStackTrace();
                }
            }
        }
    }
